import React from 'react';
import CartList from './CartList';

const Cart = ({ sentCart, checkoutStart, loadCart }) => {

    return (
        <div style={{padding: "10%"}}>
        { loadCart ? (<><CartList sentCart={sentCart}/><br /><button id="go-checkout-btn" onClick={checkoutStart} class="btn btn-primary"><div class="spinner-border spinner-border-sm" id="go-checkout-btn-load" role='status' hidden></div>Checkout</button></>) : (<div class="alert alert-secondary" role="alert">You have no items.</div>) }
        </div>
    )
}

export default Cart;
